import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";

import Login from "./components/Login";
import Home from "./components/Home";
import Navbar from "./components/navbar";
import About from "./components/About";
import Pricing from "./components/Pricing";
import Course from "./components/Course";
import AdminApp from './admin_components/AdminApp';


const App = () => {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem("userToken");
    if (token) {
      try {
        const payload = JSON.parse(atob(token.split('.')[1]));
        if (payload.exp * 1000 < Date.now()) {
          localStorage.removeItem("userToken");
        } else {
          setUser({ ...payload, token });
        }
      } catch (err) {
        localStorage.removeItem("userToken");
      }
    }
  }, []);

  const handleLogin = (userInfo) => {
    setUser(userInfo);
  };

  const handleLogout = () => {
    localStorage.removeItem("userToken");
    setUser(null);
  };

  return (
    <Router>
      <div style={{ fontFamily: "Arial" }}>
        <Navbar user={user} onLogout={handleLogout} />

        <Routes>
          {/* Public Pages */}
          <Route path="/" element={<Home user={user} />} />
          <Route path="/about" element={<About />} />
          <Route path="/pricing" element={<Pricing />} />

          {/* Auth */}
          <Route
            path="/login"
            element={!user ? <Login onLogin={handleLogin} /> : <Navigate to="/" />}
          />

          {/* Courses */}
          <Route
            path="/courses"
            element={user ? <Course user={user} /> : <Navigate to="/login" />}
          />
          <Route
            path="/courses/:id"
            element={user ? <div>Course Detail Page</div> : <Navigate to="/login" />}
          />
          <Route
            path="/add-course"
            element={user ? <div>Add Course Coming Soon</div> : <Navigate to="/login" />}
          />

          {/* Protected User Pages */}
          <Route
            path="/profile"
            element={user ? <div>Profile Page</div> : <Navigate to="/login" />}
          />
          <Route
            path="/my-courses"
            element={user ? <div>My Courses Page</div> : <Navigate to="/login" />}
          />
          <Route
            path="/settings"
            element={user ? <div>Settings Page</div> : <Navigate to="/login" />}
          />

          {/* âœ… Admin Dashboard Route */}
          <Route
            path="/admin/*"
            element={
              user?.isAdmin ? (
                <AdminApp user={user} onLogout={handleLogout} />
              ) : (
                <Navigate to="/" />
              )
            }
          />

          {/* 404 fallback */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
